('text_validator_1', 'a:4:{s:4:"name";s:5:"phone";s:5:"label";s:22:"Numéro de téléphone";s:7:"message";s:48:"\'%s\' doit être un numéro de téléphone valide";s:6:"regexp";s:36:"/^.*[0-9]{3}.*[0-9]{3}.*[0-9]{4}.*$/";}'),
('text_validator_2', 'a:4:{s:4:"name";s:5:"email";s:5:"label";s:6:"E-Mail";s:7:"message";s:46:"\'%s\' doit être une adresse de courriel valide";s:6:"regexp";s:51:"/^[A-Za-z0-9._%+-]+@[A-Za-z0-9.-]+\\.[A-Za-z]{2,4}$/";}'),
('text_validator_3', 'a:4:{s:4:"name";s:4:"date";s:5:"label";s:15:"Date (JJ/MM/YY)";s:7:"message";s:49:"\'%s\' doit être une date sous la forme (JJ/MM/YY)";s:6:"regexp";s:34:"/^[0-9]{1,2}.[0-9]{1,2}.[0-9]{2}$/";}'),
('text_validator_4', 'a:4:{s:4:"name";s:5:"state";s:5:"label";s:4:"Etat";s:7:"message";s:48:"\'%s\' doit être une abbréviation d\'état valide";s:6:"regexp";s:136:"/^(A[LKSZRAEP]|C[AOT]|D[EC]|F[LM]|G[AU]|HI|I[ADLN]|K[SY]|LA|M[ADEHINOPST]|N[CDEHJMVY]|O[HKR]|P[ARW]|RI|S[CD]|T[NX]|UT|V[AIT]|W[AIVY])$/i";}'),
('text_validator_5', 'a:4:{s:4:"name";s:3:"zip";s:5:"label";s:11:"Code postal";s:7:"message";s:37:"\'%s\' doit être un code postal valide";s:6:"regexp";s:9:"/^\\d{5}$/";}'),
('text_validator_6', 'a:4:{s:4:"name";s:10:"dimensions";s:5:"label";s:22:"Dimensions (L x l x H)";s:7:"message";s:35:"\'%s\' must be dimensions (L x l x H)";s:6:"regexp";s:71:"/^\\s*(\\d+(\\.\\d+)?)\\s*(x|X)\\s*(\\d+(\\.\\d+)?)\\s*(x|X)\\s*(\\d+(\\.\\d+)?)\\s*$/";}'),
('text_validator_7', 'a:4:{s:4:"name";s:5:"date2";s:5:"label";s:15:"Date (DD/MM/YY)";s:7:"message";s:30:"\'%s\' must be a date (DD/MM/YY)";s:6:"regexp";s:34:"/^[0-9]{1,2}.[0-9]{1,2}.[0-9]{2}$/";}') ;
INSERT INTO `wp_fm_templates` ( `title`, `filename`, `content`, `status`, `modified`) VALUES
('Form Manager Default', 'fm-form-default.php', '<?php\n/*\nTemplate Name: Form Manager Default\nTemplate Description: The default dislplay template for forms\nTemplate Type: form\n\noption: $showFormTitle, checkbox\n	label: Show form title:\n	default: checked\noption: $showBorder, checkbox\n	label: Show border:\n	default: checked	\noption: $labelPosition, select\n	label: Label position:\n	description: Labels can be placed to the left or above each field\n	options: \'left\' => \'Left\', \'top\' => \'Top\'\n	default: left\noption: $labelWidth, text\n	label: Label width (in pixels):\n	description: Applies to checkboxes, and when labels are to the left\n	default: 200\n\n	\n//////////////////////////////////////////////////////////////////////////////////////////\n\nBelow are the functions that can be used within a form display template:\n\nfm_form_start(), fm_form_end() - These can be called (not echo\'ed) to open and close the form, respectively.\nfm_form_hidden() - Nonce and other hidden values required for the form; can be omitted if fm_form_end() is used.\nfm_form_the_title() - The form\'s title\n\nThe following can be used in place of the fm_form_start() function:\nfm_form_class() - The default form CSS class\nfm_form_action() - The default form action\nfm_form_ID() - Used for the opening form tag\'s \'name\' and \'id\' attributes.\n\nfm_form_the_submit_btn() - A properly formed submit button\nfm_form_submit_btn_name() - Submit button\'s \'name\' attribute\nfm_form_submit_btn_id() - Submit button\'s \'id\' attribute\nfm_form_submit_btn_text() - Submit button\'s \'value\' attribute, as set in the form editor.\nfm_form_submit_btn_script() - Validation script\n\nfm_form_have_items() - Returns true if there are more items (used to loop through the form items, similar to have_posts() in wordpress themes)\nfm_form_the_item() - Sets up the current item (similar to the_post() in wordpress themes)\nfm_form_the_label() - The current item\'s label\nfm_form_the_input() - The current item\'s input element\nfm_form_the_nickname() - The current item\'s nickname\n\nfm_form_is_separator() - Returns true if the current element is a horizontal line\nfm_form_is_note() - Returns true if the current element is a note\nfm_form_is_required() - Returns true if the current item is set as required\nfm_form_item_type() - The current item\'s type\n\nfm_form_get_item_input($nickname) - get an item\'s input by nickname\nfm_form_get_item_label($nickname) - get an item\'s label by nickname\n\n//////////////////////////////////////////////////////////////////////////////////////////\n\n*/\n\n/* translators: the following are for the options for the default form display template */\n__("Show form title:", \'wordpress-form-manager\');\n__("Show border:", \'wordpress-form-manager\');\n__("Label position:", \'wordpress-form-manager\');\n__("Labels can be placed to the left or above each field", \'wordpress-form-manager\');\n_x(\'Left\', \'template-option\', \'wordpress-form-manager\');\n_x(\'Top\', \'template-option\', \'wordpress-form-manager\');\n__("Label width (in pixels):", \'wordpress-form-manager\');\n__("Applies to checkboxes, and when labels are to the left", \'wordpress-form-manager\');\n\n?>\n<?php echo fm_form_start(); ?>\n\n	<?php if($showBorder): ?><fieldset><?php endif; ?>\n	\n		<?php if($showFormTitle): ?>\n			<?php if($showBorder): ?>\n				<legend><?php echo fm_form_the_title(); ?></legend>\n			<?php else: ?>\n				<h2><?php echo fm_form_the_title(); ?></h2>\n			<?php endif; ?>\n		<?php endif; ?>\n		\n		<ul>\n			<?php while(fm_form_have_items()): fm_form_the_item(); ?>\n			<li id="fm-item-<?php echo (fm_form_the_nickname() != "" ? fm_form_the_nickname() : fm_form_the_ID()); ?>">\n				<?php if($labelPosition == "top"): ?>\n					<label style="display:block;width:<?php echo $labelwidth;?>px;"><?php echo fm_form_the_label(); ?>\n					<?php if(fm_form_is_required()) echo "&nbsp;<em>*</em>"; ?>\n					</label><?php echo fm_form_the_input(); ?>\n				<?php else: ?>\n					<table><tr>\n						<td style="width:<?php echo $labelWidth; ?>px"><label><?php echo fm_form_the_label(); ?><?php if(fm_form_is_required()) echo "&nbsp;<em>*</em>"; ?></label></td>\n						<td><?php echo fm_form_the_input(); ?></td>\n					</tr></table>\n				<?php endif; ?>\n			</li>\n			<?php endwhile; ?>\n		</ul>\n\n		<div>\n		 <?php echo fm_form_the_submit_btn(); ?>\n		</div>\n\n	<?php if($showBorder): ?></fieldset><?php endif; ?>\n\n	<?php echo fm_form_hidden(); ?>\n<?php echo fm_form_end(); ?>', '', 1469428764),
('Form Manager Default', 'fm-summary-default.php', '<?php\n/*\nTemplate Name: Form Manager Default\nTemplate Description: The default template for e-mail notifications and summaries\nTemplate Type: email, summary\n\n//////////////////////////////////////////////////////////////////////////////////////////\n\nBelow are the functions that can be used within a summary template:\n\nfm_summary_the_title() - the title of the form\nfm_summary_have_items() - works like have_posts() for wordpress themes.  Returns \'true\' if there are more items left in the form.\nfm_summary_the_item() - works like the_item() for wordpress themes.  Initializes the current form item.\nfm_summary_the_label() - label of the current form item\nfm_summary_the_type() - type of the current form item (text, textarea, checkbox, custom_list, note, separator, recaptcha, file)\nfm_summary_has_data() - returns true if the form element is a data element (as opposed to a separator, note, etc.)\nfm_summary_the_value() - submitted value of the current form item\nfm_summary_the_timestamp() - timestamp for the current submission\nfm_summary_the_user() - the login name for the current user.  If no user is logged in, this returns an empty string.\nfm_summary_the_IP() - the IP address of the user who submitted the form.\nfm_summary_the_nickname() - the current item\'s nickname\nfm_summary_the_parent() - post ID where the form was submitted from\n\nfm_summary_get_item_label($nickname) - get an item\'s label by nickname\nfm_summary_get_item_value($nickname) - get an item\'s value by nickname\n\n*NOTE: \'Summary\' templates can also be used for e-mails.  Notice that under \'Template Type\', both \'email\' and \'summary\' are listed.  If you want to make a template for e-mail notifications only, then you should only put \'email\' under \'Template Type\'.\n\n//////////////////////////////////////////////////////////////////////////////////////////\n\n*/\n?>\n<?php /* The title of the form */ ?>\n<h2><?php echo fm_summary_the_title(); ?></h2>\n\n<?php /* The user\'s first and last name, if there is a logged in user */ ?>\n<?php \n$userName = fm_summary_the_user(); \nif(trim($userName) != ""){\n	$userData = get_userdatabylogin($userName);\n	echo "Submitted by: <strong>".$userData->last_name.", ".$userData->first_name."</strong><br />";\n}\n?>\n\n<?php /* The time and date of the submission.  Look up date() in the PHP reference at php.net for more info on how to format timestamps. */ ?>\nOn: <strong><?php echo date("M j, Y @ g:i A", strtotime(fm_summary_the_timestamp())); ?></strong> <br />\nIP: <strong><?php echo fm_summary_the_IP(); ?></strong> <br />\n<?php /* The code below displays each form element, in order, along with the submitted data. */ ?>\n<ul id="fm-summary">\n<?php while(fm_summary_have_items()): fm_summary_the_item(); ?>\n	<?php switch(fm_summary_the_type()){\n		case \'separator\': ?><hr /><?php break;\n		default:\n		if(fm_summary_has_data()): ?>\n		<li<?php if(fm_summary_the_nickname() != "") echo " id=\\"fm-item-".fm_summary_the_nickname()."\\"";?>><?php echo fm_summary_the_label();?>: <strong><?php echo fm_summary_the_value();?></strong></li>\n	<?php endif;\n		} // end switch ?>\n<?php endwhile; ?>\n</ul>', '', 1469428764),
('Summary for Data List', 'fm-summary-multi.php', '<?php\n/*\nTemplate Name: Summary for Data List\nTemplate Description: This is used by for displaying the submission data as a list of summaries, for example the [formdata] shortcode\nTemplate Type: email, summary\n\n//////////////////////////////////////////////////////////////////////////////////////////\n\n*/\n?>\n<?php /* The user\'s first and last name, if there is a logged in user */ ?>\n<?php \n$userName = fm_summary_the_user(); \nif($userName != ""){\n	$userData = get_userdatabylogin($userName);\n	echo "Submitted by: <strong>".$userData->last_name.", ".$userData->first_name."</strong><br />";\n}\n?>\n\n<?php /* The time and date of the submission.  Look up date() in the PHP reference at php.net for more info on how to format timestamps. */ ?>\nOn: <strong><?php echo date("M j, Y @ g:i A", strtotime(fm_summary_the_timestamp())); ?></strong> <br />\nIP: <strong><?php echo fm_summary_the_IP(); ?></strong> <br />\n<?php /* The code below displays each form element, in order, along with the submitted data. */ ?>\n<ul id="fm-summary-multi">\n<?php while(fm_summary_have_items()): fm_summary_the_item(); ?>\n	<?php if(fm_summary_the_type() == \'separator\'): ?>\n		<hr />\n	<?php elseif(fm_summary_has_data()): ?>\n		<li<?php if(fm_summary_the_nickname() != "") echo " id=\\"fm-item-".fm_summary_the_nickname()."\\"";?>><?php echo fm_summary_the_label();?>: <strong><?php echo fm_summary_the_value();?></strong></li>\n	<?php endif; ?>\n<?php endwhile; ?>\n</ul>\n<hr />', '', 1469428764),
('Formulaire postuler un offre', 'fm-postuler-offre.php', '<?php\n/*\nTemplate Name: Formulaire postuler un offre\nTemplate Description: The default dislplay template for forms\nTemplate Type: form\n\noption: $showFormTitle, checkbox\n	label: Show form title:\n	default: checked\noption: $showBorder, checkbox\n	label: Show border:\n	default: checked	\noption: $labelPosition, select\n	label: Label position:\n	description: Labels can be placed to the left or above each field\n	options: \'left\' => \'Left\', \'top\' => \'Top\'\n	default: left\noption: $labelWidth, text\n	label: Label width (in pixels):\n	description: Applies to checkboxes, and when labels are to the left\n	default: 200\n\n	\n//////////////////////////////////////////////////////////////////////////////////////////\n\nBelow are the functions that can be used within a form display template:\n\nfm_form_start(), fm_form_end() - These can be called (not echo\'ed) to open and close the form, respectively.\nfm_form_hidden() - Nonce and other hidden values required for the form; can be omitted if fm_form_end() is used.\nfm_form_the_title() - The form\'s title\n\nThe following can be used in place of the fm_form_start() function:\nfm_form_class() - The default form CSS class\nfm_form_action() - The default form action\nfm_form_ID() - Used for the opening form tag\'s \'name\' and \'id\' attributes.\n\nfm_form_the_submit_btn() - A properly formed submit button\nfm_form_submit_btn_name() - Submit button\'s \'name\' attribute\nfm_form_submit_btn_id() - Submit button\'s \'id\' attribute\nfm_form_submit_btn_text() - Submit button\'s \'value\' attribute, as set in the form editor.\nfm_form_submit_btn_script() - Validation script\n\nfm_form_have_items() - Returns true if there are more items (used to loop through the form items, similar to have_posts() in wordpress themes)\nfm_form_the_item() - Sets up the current item (similar to the_post() in wordpress themes)\nfm_form_the_label() - The current item\'s label\nfm_form_the_input() - The current item\'s input element\nfm_form_the_nickname() - The current item\'s nickname\n\nfm_form_is_separator() - Returns true if the current element is a horizontal line\nfm_form_is_note() - Returns true if the current element is a note\nfm_form_is_required() - Returns true if the current item is set as required\nfm_form_item_type() - The current item\'s type\n\nfm_form_get_item_input($nickname) - get an item\'s input by nickname\nfm_form_get_item_label($nickname) - get an item\'s label by nickname\n\n//////////////////////////////////////////////////////////////////////////////////////////\n\n*/\nglobal $fm_display, $current_user;\n$form_items = array();\n$form_required = array();\nwhile(fm_form_have_items()): fm_form_the_item();\n    $form_items[fm_form_the_nickname()] = fm_form_the_ID();\n    $form_required[fm_form_the_nickname()] = fm_form_is_required();\nendwhile;\n$termInformatiques = get_term_children( ID_TAXONOMIE_INFORMATIQUE, JM_TAXONOMIE_COMPETENCE_REQUISES );\n$termCompetence = COffre::getCompetenceRequis(0);\n$termLinguistiques = $termCompetence[ID_TAXONOMIE_LINGUISTIQUES];\n$user = CUser::getById( $current_user->ID );\n$postID = ( isset($_GET[\'po\'] ) && !empty( $_GET[\'po\'] ) ) ? $_GET[\'po\'] : 0;\n$entrepriseId = get_post_meta( $postID, JM_META_SOCIETE_OFFRE_RELATION, true);\n$entreprise = JM_Societe::getById( $entrepriseId );\n$reference = get_post_meta( $postID, REFERENCE_OFFRE, true );\n?>\n<form enctype="multipart/form-data" method="post" action="<?php echo $fm_display->currentFormOptions[\'action\'];?>" name="fm-form-<?php echo $fm_display->currentFormInfo[\'ID\'];?>" id="fm-form-<?php echo $fm_display->currentFormInfo[\'ID\'];?>" autocomplete="on" novalidate="novalidate">\n	<div class="control-group">\n        <h4 class="head-accordion open">Informations personnelles</h4>\n        <div class="head-accordion">\n            <div class="col-1-2 form-field">\n				<label for="nom">Nom <span class="required">*</span></label>\n                <input type="text" placeholder="Nom" name="<?php echo $form_items[\'name_postule\'];?>" id="nom" value="<?php echo $user->nom;?>" readonly>\n            </div>\n            <div class="col-1-2 form-field">\n                <label for="prenom">Prénom <span class="required">*</span></label>\n                <input type="text" placeholder="Prénom" name="<?php echo $form_items[\'prenom_postule\'];?>" id="prenom" value="<?php echo $user->prenom;?>" readonly>\n            </div>\n	        <div class="col-1-2 form-field">\n		        <label for="email">Adresse email <span class="required">*</span></label>\n                <input type="text" placeholder="Email" name="<?php echo $form_items[\'email_postule\'];?>" id="email" value="<?php echo $user->email;?>" readonly>\n	        </div>\n        </div>\n    </div>\n	<div class="control-group">\n		<div class="col-1-1 form-field">\n		    <div class="col-1-2">\n			<h4 class="head-accordion open">Compétences Informatiques <span class="required">*</span></h4>\n				<?php if ( !empty( $termInformatiques ) && count( $termInformatiques ) > 0 ) :\n						$i=1?>\n					<?php foreach ( $termInformatiques as $termId ):\n							$term = get_term_by( "id", $termId, JM_TAXONOMIE_COMPETENCE_REQUISES );?>\n		                <label class="control control--checkbox <?php if ( count( $termInformatiques ) == $i ):?>latest<?php endif;?>"><?php echo $term->name;?>\n							<input type="checkbox"  value="<?php echo $termId;?>" name="compInfo[]">\n							<div class="control__indicator"></div>\n						</label>\n					<?php   $i++;\n							endforeach;?>\n				<?php endif;?>\n		    </div>\n		</div>\n	</div>\n	<div class="control-group">\n        <div class="col-1-1 form-field">\n	        <div class="col-1-2">\n	        <h4 class="head-accordion open">Compétences linguistiques <span class="required">*</span></h4>\n	        <?php if ( !empty( $termLinguistiques ) && count( $termLinguistiques ) > 0 ):?>\n		        <ul class="list-parent">\n		        <?php foreach ( $termLinguistiques[0] as $termParent ) :?>\n			        <li>\n			        <label class="control control--checkbox"><?php echo $termParent[\'name\'];?>\n		                <input type="checkbox"  value="<?php echo $termParent[\'id\'];?>" name="langue[]" class="parent" data-class="<?php echo sanitize_title( $termParent[\'name\'] );?>">\n		                <div class="control__indicator"></div>\n		            </label>\n			        <?php if ( isset( $termLinguistiques[$termParent[\'id\']] ) && !empty( $termLinguistiques[$termParent[\'id\']] ) && count( $termLinguistiques[$termParent[\'id\']] ) > 0 ) :?>\n				        <ul class="list-children">\n				        <?php foreach ( $termLinguistiques[$termParent[\'id\']][0] as $termChild ):?>\n					        <li>\n						        <label class="control control--checkbox"><?php echo $termChild[\'name\'];?>\n		                            <input type="checkbox"  value="<?php echo $termChild[\'id\'];?>" name="<?php echo sanitize_title( $termParent[\'name\'] );?>[]" class="<?php echo sanitize_title( $termParent[\'name\'] );?>">\n		                            <div class="control__indicator"></div>\n		                        </label>\n					        </li>\n				        <?php endforeach;?>\n				        </ul>\n			        <?php endif;?>\n			        </li>\n		        <?php endforeach;?>\n		        </ul>\n            <?php  endif;?>\n			</div>\n        </div>\n    </div>\n	<div class="control-group">\n		<div class="col-1-1 form-field">\n			<h4 class="head-accordion open">Votre message <span class="required">*</span></h4>\n			<textarea name="<?php echo $form_items[\'message_postule\'];?>" placeholder="Votre message"></textarea>\n		</div>\n	</div>\n	<div class="control-group">\n		<div class="col-1-1">\n			<h4 class="head-accordion open">Pièces jointes </h4>\n			<div class="col-1-2">\n				<input type="hidden" name="MAX_FILE_SIZE" value="10240000">\n				<input name="<?php echo $form_items[\'cv_postule\'];?>" id="fileCv" type="file" class="inputfile">\n				<label for="fileCv" class="input-file-trigger"><span>Mon CV *</span></label>\n				<em>(.doc, .rtf, .pdf, .docx)</em>\n				<span class="file-return cv"></span>\n			</div>\n			<div class="col-1-2">\n				<input type="hidden" name="MAX_FILE_SIZE" value="10240000">\n				<input name="<?php echo $form_items[\'lm_postule\'];?>" id="fileLm" type="file" class="inputfile">\n				<label for="fileLm" class="input-file-trigger"><span>Ma lettre de motivation *</span></label>\n				<em>(.doc, .rtf, .pdf, .docx)</em>\n				<span class="file-return lm"></span>\n\n			</div>\n		</div>\n	</div>\n	<div class="control-group">\n		<div class="col-1-1">\n			<h4 class="head-accordion open">Autres documents </h4>\n			<div class="col-1-2">\n				<input type="hidden" name="MAX_FILE_SIZE" value="10240000">\n				<input name="<?php echo $form_items[\'autre_postule\'];?>" id="fileAutre" type="file" class="inputfile">\n				<label for="fileAutre" class="input-file-trigger"><span>Autres documents</span></label>\n				<em>(.doc, .rtf, .pdf, .docx)</em>\n				<span class="file-return autre"></span>\n			</div>\n		</div>\n	</div>\n	<input type="submit" name="fm_form_submit" id="fm_form_submit" class="button-postuler" value="Valider" >\n	<input type="hidden" name="<?php echo $form_items[\'entreprise_postule\']?>" value="<?php echo $entreprise->titre;?>">\n	<input type="hidden" name="<?php echo $form_items[\'ref_postule\']?>" value="<?php echo $reference;?>">\n	<input type="hidden" name="fm_nonce" id="fm_nonce" value="<?php echo wp_create_nonce(\'fm-nonce\');?>" />\n	<input type="hidden" name="fm_nonce" id="fm_nonce" value="<?php echo wp_create_nonce(\'fm-nonce\');?>" />\n	<input type="hidden" name="fm_id" id="fm_id" value="<?php echo $fm_display->currentFormInfo[\'ID\'];?>" />\n	<input type="hidden" name="fm_uniq_id" id="fm_uniq_id" value="fm-<?php echo uniqid();?>" />\n	<input type="hidden" name="fm_parent_post_id" id="fm_parent_post_id" value="<?php echo $postID;?>" />\n<?php echo fm_form_end(); ?>\n', '', 1470146952),
('Formulaire candidature spontaneé', 'fm-spontanee.php', '<?php\n/*\nTemplate Name: Formulaire candidature spontaneé\nTemplate Description: The default dislplay template for forms\nTemplate Type: form\n\noption: $showFormTitle, checkbox\n	label: Show form title:\n	default: checked\noption: $showBorder, checkbox\n	label: Show border:\n	default: checked	\noption: $labelPosition, select\n	label: Label position:\n	description: Labels can be placed to the left or above each field\n	options: \'left\' => \'Left\', \'top\' => \'Top\'\n	default: left\noption: $labelWidth, text\n	label: Label width (in pixels):\n	description: Applies to checkboxes, and when labels are to the left\n	default: 200\n\n	\n//////////////////////////////////////////////////////////////////////////////////////////\n\nBelow are the functions that can be used within a form display template:\n\nfm_form_start(), fm_form_end() - These can be called (not echo\'ed) to open and close the form, respectively.\nfm_form_hidden() - Nonce and other hidden values required for the form; can be omitted if fm_form_end() is used.\nfm_form_the_title() - The form\'s title\n\nThe following can be used in place of the fm_form_start() function:\nfm_form_class() - The default form CSS class\nfm_form_action() - The default form action\nfm_form_ID() - Used for the opening form tag\'s \'name\' and \'id\' attributes.\n\nfm_form_the_submit_btn() - A properly formed submit button\nfm_form_submit_btn_name() - Submit button\'s \'name\' attribute\nfm_form_submit_btn_id() - Submit button\'s \'id\' attribute\nfm_form_submit_btn_text() - Submit button\'s \'value\' attribute, as set in the form editor.\nfm_form_submit_btn_script() - Validation script\n\nfm_form_have_items() - Returns true if there are more items (used to loop through the form items, similar to have_posts() in wordpress themes)\nfm_form_the_item() - Sets up the current item (similar to the_post() in wordpress themes)\nfm_form_the_label() - The current item\'s label\nfm_form_the_input() - The current item\'s input element\nfm_form_the_nickname() - The current item\'s nickname\n\nfm_form_is_separator() - Returns true if the current element is a horizontal line\nfm_form_is_note() - Returns true if the current element is a note\nfm_form_is_required() - Returns true if the current item is set as required\nfm_form_item_type() - The current item\'s type\n\nfm_form_get_item_input($nickname) - get an item\'s input by nickname\nfm_form_get_item_label($nickname) - get an item\'s label by nickname\n\n//////////////////////////////////////////////////////////////////////////////////////////\n\n*/\n\nglobal $fm_display, $current_user;\n$form_items = array();\n$form_required = array();\n$user = CUser::getById( $current_user->ID );\nwhile(fm_form_have_items()): fm_form_the_item();\n    $form_items[fm_form_the_nickname()] = fm_form_the_ID();\n    $form_required[fm_form_the_nickname()] = fm_form_is_required();\nendwhile;\n\n?>\n<form enctype="multipart/form-data" method="post" action="<?php echo $fm_display->currentFormOptions[\'action\'];?>" name="fm-form-<?php echo $fm_display->currentFormInfo[\'ID\'];?>" id="fm-form-<?php echo $fm_display->currentFormInfo[\'ID\'];?>" autocomplete="on" novalidate="novalidate">\n\n	<div class="control-group">\n        <h4 class="head-accordion open">Informations personnelles</h4>\n        <div class="head-accordion">\n            <div class="col-1-2 form-field">\n				<label for="nom">Nom<span class="required">*</span></label>\n                <input type="text" autocomplete="off" placeholder="Nom" name="<?php echo $form_items[\'nom_spontanee\'];?>" id="nom" value="<?php echo $user->nom;?>" <?php if ( is_user_logged_in() && !empty( $user->nom ) ) :?>readonly<?php endif;?>>\n            </div>\n            <div class="col-1-2 form-field">\n                <label for="prenom">Prénom <span class="required">*</span></label>\n                <input type="text" autocomplete="off" placeholder="Prénom" name="<?php echo $form_items[\'prenom_spontanee\'];?>" id="prenom" value="<?php echo $user->prenom;?>" <?php if ( is_user_logged_in() && !empty( $user->prenom ) ) :?>readonly<?php endif;?>>\n            </div>\n	        <div class="col-1-2 form-field">\n		        <label for="email">Adresse email <span class="required">*</span></label>\n                <input type="text" autocomplete="off" placeholder="Email" name="<?php echo $form_items[\'email_spontanee\'];?>" id="email" value="<?php echo $user->email;?>" <?php if ( is_user_logged_in() && !empty( $user->email ) ) :?>readonly<?php endif;?>>\n	        </div>\n	        <div class="col-1-2 form-field">\n		        <label for="email">Numéro de téléphone</label>\n                <input type="text" autocomplete="off" placeholder="Numéro de téléphone" name="<?php echo $form_items[\'num_phone_spontanee\'];?>" id="phone" value="<?php echo ( !empty( $user->phone_number ) )? $user->phone_number : "";?>" <?php if ( is_user_logged_in() && !empty( $user->phone_number ) ) :?>readonly<?php endif;?>>\n	        </div>\n        </div>\n    </div>\n	<div class="control-group">\n		<div class="col-1-1 form-field">\n			<h5 class="head-accordion open">Votre Message</h5>\n			<textarea name="<?php echo $form_items[\'message_spontanee\'];?>" placeholder="Votre message"></textarea>\n		</div>\n	</div>\n	<div class="control-group">\n		<div class="col-1-1 form-field">\n			<h5 class="head-accordion open">Pièces jointes</h5>\n			<div class="col-1-2">\n				<input type="hidden" name="MAX_FILE_SIZE" value="10240000">\n				<input name="<?php echo $form_items[\'cv_spontanee\'];?>" id="fileCv" type="file" class="inputfile">\n				<label for="fileCv" class="input-file-trigger"><span>Mon CV *</span></label>\n				<em>(.doc, .rtf, .pdf, .docx)</em>\n				<span class="file-return cv"></span>\n			</div>\n			<div class="col-1-2">\n				<input type="hidden" name="MAX_FILE_SIZE" value="10240000">\n				<input name="<?php echo $form_items[\'lm_spontanee\'];?>" id="fileLm" type="file" class="inputfile">\n				<label for="fileLm" class="input-file-trigger"><span>Ma lettre de motivation *</span></label>\n				<em>(.doc, .rtf, .pdf, .docx)</em>\n				<span class="file-return lm"></span>\n\n			</div>\n		</div>\n	</div>\n	<input type="submit" name="fm_form_submit" id="fm_form_submit" class="button-spontanne" value="Valider" >\n	<input type="hidden" name="fm_nonce" id="fm_nonce" value="<?php echo wp_create_nonce(\'fm-nonce\');?>" />\n	<input type="hidden" name="fm_nonce" id="fm_nonce" value="<?php echo wp_create_nonce(\'fm-nonce\');?>" />\n	<input type="hidden" name="fm_id" id="fm_id" value="<?php echo $fm_display->currentFormInfo[\'ID\'];?>" />\n	<input type="hidden" name="fm_uniq_id" id="fm_uniq_id" value="fm-<?php echo uniqid();?>" />\n<?php echo fm_form_end(); ?>', '', 1470232319) ;
