(6619, 'aam-extension-repository', 'a:7:{i:0;O:8:"stdClass":5:{s:5:"title";s:16:"AAM Plus Package";s:5:"price";s:7:"$30 USD";s:11:"description";s:295:"Unlock limitations related to Posts and Pages feature. Extend basic AAM functionality with Page Categories and ability to manage access to your comments (AAM Plus Package adds new capabilities to the default list of WordPress capabilities like Edit Comments, Delete Comments, Spam Comments etc.)";s:7:"version";s:3:"2.4";s:7:"created";s:10:"2015-10-25";}i:1;O:8:"stdClass":5:{s:5:"title";s:13:"AAM Utilities";s:5:"price";s:4:"Free";s:11:"description";s:64:"Various useful tools for AAM like caching or clear all settings.";s:7:"version";s:5:"1.3.3";s:7:"created";s:10:"2015-11-03";}i:2;O:8:"stdClass":5:{s:5:"title";s:13:"AAM Multisite";s:5:"price";s:4:"Free";s:11:"description";s:179:"Convenient way to navigate between different sites in the Network Admin Panel. This extension adds additional widget to the AAM page that allows to switch between different sites.";s:7:"version";s:5:"2.1.2";s:7:"created";s:10:"2015-11-05";}i:3;O:8:"stdClass":5:{s:5:"title";s:23:"AAM Development License";s:5:"price";s:8:"$150 USD";s:11:"description";s:119:"Development license gives you an ability to download all the available extensions and use them to up to 5 life domains.";s:7:"version";s:5:"1.2.6";s:7:"created";s:10:"2015-11-08";}i:4;O:8:"stdClass":5:{s:5:"title";s:15:"AAM Post Filter";s:5:"price";s:4:"Free";s:11:"description";s:217:"WARNING! Please use with caution. This is a supportive exention for the post access option List. It adds additional post filtering to fix the issue with large amount of post. Caching turned on is strongly recommended.";s:7:"version";s:5:"1.0.1";s:7:"created";s:10:"2015-12-08";}i:5;O:8:"stdClass":5:{s:5:"title";s:15:"AAM Role Filter";s:5:"price";s:6:"$5 USD";s:11:"description";s:208:"Extension for more advanced user and role administration. Based on user\'s highest level capability, filter list of roles with higher