(2, 1, '2016-06-21 14:28:32', '2016-06-21 13:28:32', '<p>Le <strong>Lorem Ipsum</strong> est simplement du faux texte employé dans la composition et la mise en page avant impression. Le Lorem Ipsum est le faux texte standard de l\'imprimerie depuis les années 1500, quand un peintre anonyme assembla ensemble des morceaux de texte pour réaliser un livre spécimen de polices de texte. Il n\'a pas fait que survivre cinq siècles, mais s\'est aussi adapté à la bureautique informatique, sans que son contenu n\'en soit modifié. Il a été popularisé dans les années 1960 grâce à la vente de feuilles Letraset contenant des passages du Lorem Ipsum, et, plus récemment, par son inclusion dans des applications de mise en page de texte, comme Aldus PageMaker.</p>', 'Le groupe Telma', '', 'publish', 'open', 'open', '', 'page-d-exemple', '', '', '2016-07-20 12:15:52', '2016-07-20 11:15:52', '', 0, 'http://tsgt02lv/jobopportunity /?page_id=2', 0, 'page', '', 0),
